import React from "react";

import { FaPlusCircle, ImFacebook} from '@react-icons/all-files/fa/fa';

import "./topbar.scss"

const TopBar = () => {
    return (
      <nav className="topBar">
        <div className="edgesEfect"/>
        <h1><ImFacebook /></h1>
        <div className="text">
          <input type="text" />
          <textarea type="text" oninput='if(this.scrollHeight > this.offsetHeight) this.rows += 1'/>
        </div>
          <button className="btn-addPlus"><FaPlusCircle /></button>
      </nav>
    )
}

export default TopBar;
